import "./App.css";
import React, { Component } from "react";
import Navbar from "./Components/Navbar";
import News from "./Components/News";
import ReactDOM from "react-dom/client";
import { BrowserRouter, Routes, Route } from "react-router-dom";

export default class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <Navbar />
        <News pagesize={4} country="in" category="general" />
        <Routes>
          <Route
            path="/general"
            element={<News pageSize={4} country="in" category="general" />}
          />
          <Route
            path="/business"
            element={<News pageSize={4} country="in" category="business" />}
          />
          <Route
            path="/health"
            element={<News pageSize={4} country="in" category="health" />}
          />
          <Route
            path="/science"
            element={<News pageSize={4} country="in" category="science" />}
          />
          <Route
            path="/technology"
            element={<News pageSize={4} country="in" category="technology" />}
          />
          <Route
            path="/sports"
            element={<News pageSize={4} country="in" category="sports" />}
          />
        </Routes>
      </BrowserRouter>
    );
  }
}
